    - type: Paper
      stampState: paper_stamp-ce
      stampedBy:
      - stampedColor: '#C69B17FF'
        stampedName: stamp-component-stamped-name-ce
      content: >-
        Как правильно настроить двигатель суперматерии.


        [bold]ПРИНЦИП РАБОТЫ СУПЕРМАТЕРИИ:[/bold]

        - Суперматерия потребляет азот, и выделяет тёплую плазму с кислородом.

        - Для работы суперматерии необходимо воздействие эмиттеров.

        - Суперматерия стабильна, пока температура не превышет 100 градусов, а в камере присутствует азот.

        - В нормальных условиях, суперматерия производит около 3,5 рад. непосредственно вокруг себя.


        Тем самым, чтобы поддерживать суперматерию стабильной, вы должны фильтровать всё лишнее, и поддерживать низкую температуру азота.


        [bold]КАК ЗАПУСТИТЬ ДВИГАТЕЛЬ СУПЕРМАТЕРИИ:[/bold]

        1. Настроить Дистро в атмосии, включить в этой комнате самый близкий ко входу фильтр на азот и газовый насос

        2. Настроить воздушную сигнализацию: 2 скруббера на всасывание всех газов, 1 на всасывание всех газов кроме азота. Объём всасывания поставьте везде на 50 Л. Не забудьте выключить авто-режим в правом нижнем углу!

        3. Возьмите несколько баллонов плазмы из раздатчика, наденьте радиационный костюм и нажмите на кнопку, которая находится правее этого листка. Активируйте все коллекторы рациации и заправьте по необходимости

        4. Включите охладители на минимум, фильтры рядом с охладителями на азот, и насосы, находящиеся ниже фильтра

        5. Активируйте все эммитеры и снова нажмите на кнопку из шага 3.


        [bold]ЧТО ДЕЛАТЬ, ЕСЛИ РЕАКТОР ЗАГОРЕЛСЯ:[/bold]

        1. Если вы увидите горение плазмы в реакторе суперматерии, НЕМЕДЛЕННО нажмите на кнопку, которая находится в северной части комнаты реактора на стене возле плазменных бронеокон. Нажав её вы активируете гермозатворы, благодаря чему вы сольёте всё лишнее в космос.

        2. Выключите 2 насоса подачи азота слева и справа реактора.

        3. Проследите за тем, чтобы вся камера суперматерии опустела. В случае если даже слив с помощью гермозатворов не помог, попытайтесь вскрыть полы в реакторе при помощи РСУ. Любой ценой предотвратите взрыв реактора, любой ценой опустошите камеру сгорания. 

        4. Как только очистите камеру и трубы, запустите систему с самого начала.


        Поздравляю, вы успешно научились контролировать двигатель суперматерии! Южнее в космосе находится заготовка для защиты от метеоров на основе генераторов сдерживающего поля - активируйте его по желанию, чтобы на 100% обеспечить безопасность генератора. Удачного вам строительства!


        - С уважением, Лакакович Калашников
